import React from 'react';
// import { useNavigate } from 'react-router-dom';
import {
  Button, Col, Form, FormGroup, Input, Label, Row,
} from 'reactstrap';

export default function ClubOrUser() {
  // const navigate = useNavigate();
  return (
    <Form>
      <Row>
        <Col md={{
          offset: 3,
          size: 6,
        }}
        >

          <Label for="exampleEmail">
            Название клуба
          </Label>
          <Input
            name="clubName"
            placeholder="Как называется ваш клуб"
            type="text"
          />

          <FormGroup>
            <Label for="exampleAddress">
              Address
            </Label>
            <Input
              id="exampleAddress"
              name="address"
              placeholder="1234 Main St"
            />
          </FormGroup>
        </Col>
      </Row>
      <Row>
        <Col md={{
          offset: 3,
          size: 6,
        }}
        >
          <FormGroup>
            <Label for="exampleEmail">
              Email
            </Label>
            <Input
              id="exampleEmail"
              name="email"
              placeholder="with a placeholder"
              type="email"
            />
          </FormGroup>
        </Col>
        <Col md={{
          offset: 3,
          size: 6,
        }}
        >
          <FormGroup>
            <Label for="examplePassword">
              Password
            </Label>
            <Input
              id="examplePassword"
              name="password"
              placeholder="password placeholder"
              type="password"
            />
          </FormGroup>
        </Col>
      </Row>
      <Col md={{
        offset: 3,
        size: 6,
      }}
      >
        <Button>
          Sign in
        </Button>

      </Col>
    </Form>
  );
}
